import Type from "./Type";

function App() {
  return (
    <div className="App">
      <NavTest/><br/><br/><br/><br/>
      <Menutest/>
      <Type/>
      <Tabs 
        indicatorColor="secondary" 
        textColor="secondary"
        value={value} 
        onClick={(e,val)=>setValue(val)}>
            <Tab label="first"/>
            <Tab label="second"/>
            <Tab label="third"/>
        </Tabs>
      <Buttin/>
      <TextFill/>
    </div>
  );
}

export default App;
